import logo from './logo.svg';
import './App.css';

import CompShowUsers from './user/ShowUsers';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <BrowserRouter>
        <Routes>
          <Route path='/' element={<CompShowUsers/>}></Route>
        </Routes>
        </BrowserRouter>
      </header>
      <CompShowUsers></CompShowUsers>
    </div>
  );
}

export default App;
